import React, { Component } from "react";

class Post extends Component {
  render() {
    return (
      <div class="list-group-item comment user-comment">
        <div class="info">
          <a href="#">Anie Silverston</a>
          <span>4 hours ago</span>
        </div>
        <a class="avatar" href="#">
          <img
            src="images/avatar_user_1.jpg"
            width="35"
            alt="Profile Avatar"
            title="Anie Silverston"
          />
        </a>
        <p>Suspendisse gravida sem?</p>
      </div>
    );
  }
}

export default Post;
